import React from "react";

const header = () => {
  return (
    <header>
      <h1>Meu Portfólio</h1>
      <nav>
        <a href="#about">Sobre Mim</a>
        <a href="#skills">Habilidades</a>
        <a href="#education">Formação</a>
        <a href="#projects">Projetos</a>
        <a href="#contact">Contato</a>
      </nav>
    </header>
  );
};

export default header;
